// SPDX-License-Identifier: MIT
pragma solidity >=0.4.22 <0.9.0;

contract ExpenseTracker {

    struct Transaction {
        string name;
        uint price;
        string description;
    }

    mapping(address => Transaction) public itemByAddress;
    Transaction[] transactions;

    function setItem(string memory _name,string memory _description, uint _price ) public {
        require(_price > 0, "Price must be greater then zero");
        Transaction memory transaction = Transaction(_name, _price, _description);
        itemByAddress[msg.sender] = transaction;
        transactions.push( transaction );
    }

    function getItemsByAddress( address _addr ) public view returns( string memory, string memory, uint ){
        Transaction memory ownerTransactions = itemByAddress[_addr];
        return(ownerTransactions.name, ownerTransactions.description, ownerTransactions.price);
    }

    function getItemCount() public view returns( uint ) {
        return transactions.length;
    }
}
